import React from "react";
import "./WhatWeDoData";
import "./css/WhatWeDo.css";
// import { data } from "./WhatWeDoData";

function WhatWeDo() {
  const data = [
    {
      path: "./Images/management.jpg",
      title: "Management and Inventory",
      link: "Learn More",
      text: "Lorem ipsum dolor sit amet consectetur adipisicing",
    },
    {
      path: "./Images/maintanance.jpg",
      title: "Maintanance",
      link: "Learn More",
      text: "Lorem ipsum dolor sit amet consectetur adipisicing",
    },
    {
      path: "./Images/installation.jpg",
      title: "Installation",
      link: "Learn More",
      text: "Lorem ipsum dolor sit amet consectetur adipisicing",
    },
    {
      path: "./Images/consultation.jpg",
      title: "Consultation",
      link: "Learn More",
      text: "Lorem ipsum dolor sit amet consectetur adipisicing",
    },
  ];
  return (
    <div className="what__we__do">
      <div className="WhatWeDo__header">
        <h1>What we do?</h1>
      </div>
      {data.map((data, idx) => (
        <div className="whatWeDo__activity">
          <div className="whatwedo__image__container">
            <img src={data.path} alt="" className="whatwedo__image" />
          </div>
          <div className="whatwedo__title">{data.title}</div>
          <div className="whatwedo__text">{data.text}</div>
          <div className="whatwedo__link">{data.link}</div>
        </div>
      ))}
    </div>
  );
}

export default WhatWeDo;
